import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { useOutletContext } from 'react-router-dom';
import  Button  from '@mui/material/Button';
import Typography  from '@mui/material/Typography';
import Select from '@mui/material/Select';
import Stack from '@mui/material/Stack';
import Divider from '@mui/material/Divider';
import Home from './Home';

const Create = () => {
 

  
  const navigate = useNavigate();
  const handleSubmit = (e) => {
    e.preventDefault();
    const blog = { firstName, body, title };

    fetch('http://localhost:8000/quads/', {
      method: 'POST',
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(blog)
    }).then(() => {
      // history.go(-1);
      navigate.push('/');
    })
  }

  const { user } = useOutletContext();

  const [firstName, setFirstName] = useState(user?.metadata?.firstName ?? '');
  const [title, setTitle] = useState('');
  const [body, setBody] = useState('');
  return (
    <div>


         <input 
          type="text" 
          required 
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          /> 

       
     
     
         
          
    
          

         <Stack
        divider={<Divider orientation="vertical" color="error" flexItem />} 
        direction="row-reverse" spacing={2}
        justifyContent="center">
         
        
         <Button color='error' onClick={handleSubmit}>Jelentkezem</Button>
        
         
         <Typography variant="h3" color='error'>Jelentkez a versenyre:</Typography>
           
    
         
        
         <Home/>

         

         <Select
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)} >
          <option value={user?.metadata?.firstName }>{user?.metadata?.firstName }</option>
         </Select>

         <Typography>Jelentkezok:</Typography>
        

         </Stack>
    </div>
  );
}
 
export default Create;
